window.bookSummaryJSON = "<p><b>Meet Darby. Coffee addict. Homicide detective. Oh, and she can see ghosts, too.</b><br> <br> There are only three rules in Darby Adler's life.<br> <b>One:</b> Don't talk to the dead in front of the living.<br> <b>Two:</b> Stay off the Arcane Bureau of Investigation's radar.<br> <b>Three:</b> Don't forget rules one and two.<br> <br> With a murderer desperate for Darby's attention and an ABI agent in town, things are about to get mighty interesting in Haunted Peak, TN.</p> <p><b>The Grave Talker complete series includes all seven books in this thrilling urban fantasy romance series.</b></p>"; 
